import React from 'react';
import { Container } from './styles';
import Doctors from '../../../assets/doctors.svg';

const SecondSection: React.FC = () => {
  return (
    <Container>
      <div>
        <Doctors />
      </div>
    </Container>
  );
};

export default SecondSection;
